package _03_Fones_De_Ouvido;

public class Fone {
	private String marca;
	private String modelo;
	
	public Fone(String marca, String modelo) {
		// TODO Auto-generated constructor stub
		this.marca = marca;
		this.modelo = modelo;
	}
	
	public String getMarca() {
		return marca;
	}
	
	public String getModelo() {
		return modelo;
	}
	


}
